import React from "react";

class CountryDisplay extends React.Component {
  constructor(props) {
    super(props);
  }

  render() {
    return (
      <section class="main">
        <h1>Country name</h1>
        <img src="URL"></img>
        <h3>Capital</h3>
        <h3>Population</h3>
        <h3>Language</h3>
        <h3>Currency</h3>
      </section>
    );
  }
}

export default CountryDisplay;
